import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';
import { AppProvider } from '@toolpad/core/AppProvider';
import { SignInPage } from '@toolpad/core/SignInPage';
import { useTheme } from '@mui/material/styles';

const providers = [{ id: 'credentials', name: 'Email, Password, FirstName, LastName' }];

function FirstNameField(props) {
  return <TextField {...props} name="FirstName" label="PrÃ©nom" />;
}

function LastNameField(props) {
  return <TextField {...props} name="LastName" label="Nom" />;
}

export default function SlotPropsSignIn() {
  const theme = useTheme();
  return (
    <AppProvider theme={theme}>
      <SignInPage
        signIn={(provider, formData) =>
          alert(
            `Signing in with "${provider.name}" and credentials: ${formData.get('email')}, ${formData.get('FirstName')}, ${formData.get('LastName')}, ${formData.get('password')} and checkbox value: ${formData.get('tandc')}`,
          )
        }
        slots={{
          firstNameField: FirstNameField,
          lastNameField: LastNameField,
        }}
        slotProps={{
          emailField: { variant: 'standard', autoFocus: false },
          passwordField: { variant: 'standard' },
          firstNameField: { variant: 'standard' },
          lastNameField: { variant: 'standard' },
          submitButton: { variant: 'outlined' },
          rememberMe: {
            control: (
              <Checkbox
                name="tandc"
                value="true"
                color="primary"
                sx={{ padding: 0.5, '& .MuiSvgIcon-root': { fontSize: 20 } }}
              />
            ),
            color: 'textSecondary',
            label: 'I agree with the T&C',
          },
        }}
        providers={providers}
      />
    </AppProvider>
  );
}
